channel_description:
A educação não pode parar. Estude para o Enem 2020 com o melhor cursinho online: http://bit.ly/3aP6hqY

No nosso site, você tem acesso a:
- Cronograma de estudos de aulas ao vivo, com tudo o que estudar para o Enem 2020, semana a semana, até a prova. Tipo um cursinho presencial, só que online;
- Biblioteca de aulas gravadas;
- Monitorias para tirar dúvidas; 
- Exercícios e simulados para treinar e ver seu progresso;
- Todas as questões do Enem resolvidas em vídeo;
- Correção de redação com os critérios da banca do Enem, para treinar para a parte da prova que mais vale
- Aulas do Guia do Estudo Perfeito para te ensinar como estudar para o Enem e vestibulares
- App com todo conteúdo de aulas, materiais de apoio, exercícios.

No nosso canal também tem conteúdo rolando todos os dias para você conhecer os nossos professores e o nosso jeitinho de ensinar. Mas isso aqui é só um pedacinho do mundão que é a plataforma.

Bons estudos!
